(97, 2, 19, 'Instalaciones exclusivas para el lavado de artículos de limpieza.', 1),
(98, 2, 19, 'Lavado de manos: En cocinas y áreas de preparación de alimentos cuentan por lo menos con una estación exclusiva y equipada para el lavado de manos.', 1),
(99, 2, 19, 'Solo se emplean utensilios de superficie inerte', 1),
(100, 2, 19, '*Las tablas cuchillos y utensilios se lavan y desinfectan después de su uso', 1),
(101, 2, 19, 'Utilizan trapos exclusivos para limpieza de mesas, superficies de trabajo e instalaciones', 1),
(102, 2, 19, '*Los trapos utilizados en el área de preparación de alimentos se lavan y desinfectan después de su uso.', 1),
(103, 2, 19, 'Carros de servicio, entrepaños, gavetas y repisas limpios y en buen estado.', 1),
(104, 2, 19, 'Almacenan utensilios en un área específica y limpia', 1),
(105, 2, 19, 'Limpian y desinfectan mesas de trabajo antes y después de su uso. En procesos continuos no exceden las dos horas', 1),
(106, 2, 19, 'El lavado manual de loza, cubiertos y utensilios se realiza escamochando cada pieza, lavar pieza por pieza, enjuagar con agua potable a chorro, desinfectar con un producto aprobado o en agua caliente de 75 a 82°C por 30 seg., secar a temperatura ambiente, con toallas de papel o trapos secos destinados para tal fin', 1),
(107, 2, 19, 'Lavan y desinfectan utensilios', 1),
(108, 2, 19, 'Las temperaturas de la máquina lavaloza son las especificadas por el fabricante y/o del proveedor de productos químicos', 1),
(109, 2, 19, 'Escamochan y enjuagan los utensilios antes de introducirlos a la máquina', 1),
(110, 2, 19, 'La carga de utensilios es adecuada a la capacidad de la máquina.', 1),
(111, 2, 19, 'En caso de emplear trapos para secar, éstos deben estar limpios, de colores claros, exclusivos para este fin, de tamaño suficiente para que las manos no toquen los utensilios; cambiarse por trapos limpios y secos una vez mojados. Deben lavarse y desinfectarse después de su uso.', 1),
(112, 2, 19, 'Los botes de basura están identificados por tipo de desecho orgánico e inorgánico cuentan con bolsa de plástico y están tapados mientras no están en uso continuo.', 1),
(113, 2, 19, 'Realizan la limpieza conforme al programa establecido.', 1),
(114, 2, 20, '*Los alimentos de origen vegetal se lavan en forma individual o en manojos pequeños con agua potable, estropajo o cepillo (si es necesario), jabón o detergente, se enjuagan con agua potable y desinfectan.', 1),
(115, 2, 20, '*Se planea de antemano la descongelación de alimentos, por medio de:\n1. Refrigeración.\n2. Horno de microondas, siguiendo de inmediato la cocción del alimento.\n3. Como parte del proceso de cocción.\nEn casos excepcionales se descongela a chorro de agua potable, a una temperatura máxima de 20°C evitando estancamientos.', 1),
(116, 2, 20, '*No se sirven pescados, mariscos, ni carnes crudas.', 1),
(117, 2, 20, '* Los alimentos preparados que no se van a servir de inmediato se someten a un proceso de enfriamiento rápido, máximo 4 horas.', 1),
(118, 2, 20, 'Los alimentos descongelados, no se vuelven a congelar.', 1),
(119, 2, 20, 'Se usan utensilios que minimizan el contacto directo de las manos con el alimento, tales como cucharones, pinzas, tenedores, etc.', 1),
(120, 2, 20, 'El personal se lava las manos antes de manipular alimentos, vajilla limpia y después de cualquier situación que implique contaminación', 1),
(121, 2, 20, 'En caso de usar guantes, se exige el lavado de manos antes de colocárselos. Estos son desechables y se cambian después de cada interrupción.', 1),
(122, 2, 21, 'Alimentos fríos listos para servirse y buffet a una temperatura máxima de 7°C.', 1),
(123, 2, 21, 'Alimentos calientes listos para servirse y buffet a una temperatura mínima de 60°C', 1),
(124, 2, 21, 'Los alimentos preparados y listos para servirse están cubiertos antes de iniciar el servicio', 1),
(125, 2, 21, 'Los utensilios de servicio no se tocan por la parte que entra en contacto con los alimentos o con la boca del comensal.', 1),
(126, 2, 21, 'Los alimentos envasados en porción individual cumplen con las instrucciones del fabricante para su conservación, y una vez utilizadas se desechan.', 1),
(127, 2, 21, 'Manteles y servilletas limpios.', 1),
(128, 2, 21, 'Área y estaciones de servicio limpias y funcionando.', 1),
(129, 2, 21, 'Los alimentos listos para servirse, se transportan en recipientes cerrados o envases desechables.', 1),
(130, 2, 21, 'Los alimentos preparados que se transportan, no se exponen a la zona de peligro de temperaturas por más de dos horas.', 1),
(131, 2, 22, 'Agua potable con un rango de 0.2 a 1.5 mg/ L (ppm) de cloro residual o análisis microbiológico por lo menos una vez al mes.', 1),
(132, 2, 22, 'Registros de potabilidad del agua.', 1),
(133, 2, 22, 'Hielo para consumo humano elaborado con agua purificada y/o potable.', 1),
(134, 2, 22, 'Se cuenta con registros de mantenimiento de equipo de potabilización y/o purificación de agua y máquina de hielo.', 1),
(135, 2, 22, 'El depósito de hielo está limpio.', 1),
(136, 2, 22, 'Utensilios exclusivos como cucharón y/o pinzas para hielo, limpios y desinfectados.', 1),
(137, 2, 22, 'El hielo para consumo humano no se utiliza para otros fines, como es el enfriamiento de bebidas.', 1),
(138, 2, 23, 'Área general de basura limpia y separada del área de alimentos. Contenedores limpios e identificados, en buen estado con tapa (Con bolsa de plástico según el caso)', 1),
(139, 2, 23, 'Los botes de basura están identificados por tipo de desecho orgánico e inorgánico cuentan con bolsa de plástico y están tapados mientras no estén en uso continuo', 1),
(140, 2, 23, 'Se evita la acumulación excesiva de basura, en las áreas de manejo de alimentos. Los depósitos se lavan y desinfectan al final de la jornada.', 1),
(141, 2, 24, 'Se tiene contratado un servicio profesional para el control de plagas presentando:\n1. Licencia federal sanitaria expedida por la autoridad correspondiente.\n2. Hojas de seguridad del plaguicida utilizado y registro de COFEPRIS.\n3. Programa de control de plagas.\n4. Registros e informes que amparen el servicio durante los últimos tres meses.\n5. Contrato de servicio vigente', 1),
(142, 2, 24, 'Ausencia de trampas con cebos y eliminador de insectos de choque eléctrico de atracción de choque eléctrico, en el área de manejo de alimentos', 1),
